import '../css/ProfileSettings1.css';
import '../App.css';
/* too verbose of a title? wanted to make it clear which page. 
This being the first of two profile settings pages, after the registration page */

export default function Login() {
    return(
        <div>
            <h1>Profile</h1>
            <div class="slidecontainer">
                <input type="range" min="0" max="" value="50" class="slider" id="myRange"></input>
            </div>
            <div class="flex-container">
                <div class="photo"></div>
                <div class="name"></div>
                <div class="age"></div>
                <div class="gender"></div>
                <div class="ethnicity"></div>
                <div class="next"></div>
                <div class="back"></div>
            </div>
            

        </div>
        
    );
}
